const initialState = {
    country: [],
    convertedCurrency:[]
}

export default function (state = initialState, action) {
    switch (action.type) {
        case 'ADD_COUNTRY': return {
            country: [action.payload],
            convertedCurrency: [1, action.payload]
        }
        default:
            return state
    }
}
